/// Interactive playground page for testing icon animations
class PlaygroundPage extends StatefulWidget {
  const PlaygroundPage({super.key});

  @override
  State<PlaygroundPage> createState() => _PlaygroundPageState();
}

class _PlaygroundPageState extends State<PlaygroundPage> {
  late PlaygroundController _controller;

  @override
  void initState() {
    super.initState();
    _controller = PlaygroundController();
  }

  @override
  void dispose() {
    _controller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return ListenableBuilder(
      listenable: _controller,
      builder: (context, _) {
        return Row(
          crossAxisAlignment: CrossAxisAlignment.start,
          children: [
            // Left: Icon Grid (Scrollable)
            Expanded(
              child: _IconGrid(
                selectedIcon: _controller.state.selectedIcon,
                iconSize: _controller.state.size,
                iconColor: _controller.state.color,
                animationType: _controller.state.animationType,
                animationDirection: _controller.state.animationDirection,
                duration: _controller.state.duration,
                curve: _controller.state.curve,
                onIconSelected: _controller.selectIcon,
              ),
            ),

            // Right: Control Panel (Fixed)
            _ControlPanel(
              state: _controller.state,
              onSizeChanged: _controller.updateSize,
              onColorChanged: _controller.updateColor,
              onDurationChanged: _controller.updateDuration,
              onAnimationTypeChanged: _controller.updateAnimationType,
              onAnimationDirectionChanged: _controller.updateAnimationDirection,
              onCurveChanged: _controller.updateCurve,
              onClearSelection: _controller.clearSelection,
            ),
          ],
        );
      },
    );
  }
}

/// Icon grid widget displaying all available icons with search and lazy loading
class _IconGrid extends StatefulWidget {
  const _IconGrid({
    required this.selectedIcon,
    required this.iconSize,
    required this.iconColor,
    required this.animationType,
    required this.animationDirection,
    required this.duration,
    required this.curve,
    required this.onIconSelected,
  });

  final String? selectedIcon;
  final double iconSize;
  final Color iconColor;
  final MconAnimationType animationType;
  final MconAnimationDirection animationDirection;
  final Duration duration;
  final Curve curve;
  final Function(String) onIconSelected;

  @override
  State<_IconGrid> createState() => _IconGridState();
}

class _IconGridState extends State<_IconGrid> {
  String _searchQuery = '';
  final TextEditingController _searchController = TextEditingController();

  @override
  void dispose() {
    _searchController.dispose();
    super.dispose();
  }

  List<mcon.IconData> get _filteredIcons {
    if (_searchQuery.isEmpty) {
      return mcon.AvailableIcons.all;
    }
    return mcon.AvailableIcons.all.where((icon) {
      return icon.name.toLowerCase().contains(_searchQuery.toLowerCase()) ||
          icon.displayName.toLowerCase().contains(_searchQuery.toLowerCase());
    }).toList();
  }

  @override
  Widget build(BuildContext context) {
    final filteredIcons = _filteredIcons;

    // Calculate grid dimensions based on icon size
    const padding = 32.0; // Icon item internal padding
    const spacing = 16.0; // Grid spacing
    final itemWidth = widget.iconSize + padding * 2;
    final itemHeight = widget.iconSize + padding * 2 + 24; // +24 for icon name

    // Calculate how many columns fit in the available width
    final availableWidth =
        MediaQuery.of(context).size.width - 64; // Container padding
    final crossAxisCount =
        (availableWidth / (itemWidth + spacing)).floor().clamp(2, 12);

    final childAspectRatio = itemWidth / itemHeight;

    return Column(
      children: [
        // Header and Search
        Container(
          padding: const EdgeInsets.all(32),
          child: Column(
            crossAxisAlignment: CrossAxisAlignment.start,
            children: [
              Text(
                'Icon Playground',
                style: Theme.of(context).textTheme.headlineLarge?.copyWith(
                      fontWeight: FontWeight.bold,
                      letterSpacing: -0.5,
                    ),
              ),
              const SizedBox(height: 8),
              Text(
                'Click any icon to apply animations and customize its appearance',
                style: Theme.of(context).textTheme.bodyLarge?.copyWith(
                      color: Theme.of(context)
                          .colorScheme
                          .onSurface
                          .withValues(alpha: 0.6),
                    ),
              ),
              const SizedBox(height: 24),
              // Search bar
              TextField(
                controller: _searchController,
                decoration: InputDecoration(
                  hintText: 'Search icons...',
                  prefixIcon: const Icon(Icons.search),
                  suffixIcon: _searchQuery.isNotEmpty
                      ? IconButton(
                          icon: const Icon(Icons.clear),
                          onPressed: () {
                            _searchController.clear();
                            setState(() => _searchQuery = '');
                          },
                        )
                      : null,
                  border: OutlineInputBorder(
                    borderRadius: BorderRadius.circular(12),
                  ),
                ),
                onChanged: (value) {
                  setState(() => _searchQuery = value);
                },
              ),
              const SizedBox(height: 16),
              Text(
                '${filteredIcons.length} icon${filteredIcons.length == 1 ? '' : 's'}',
                style: Theme.of(context).textTheme.bodyMedium?.copyWith(
                      color: Theme.of(context)
                          .colorScheme
                          .onSurface
                          .withValues(alpha: 0.6),
                    ),
              ),
            ],
          ),
        ),
        // Grid with lazy loading
        Expanded(
          child: filteredIcons.isEmpty
              ? Center(
                  child: Text(
                    'No icons found',
                    style: Theme.of(context).textTheme.bodyLarge?.copyWith(
                          color: Theme.of(context)
                              .colorScheme
                              .onSurface
                              .withValues(alpha: 0.6),
                        ),
                  ),
                )
              : GridView.builder(
                  padding:
                      const EdgeInsets.symmetric(horizontal: 32, vertical: 16),
                  gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
                    crossAxisCount: crossAxisCount,
                    mainAxisSpacing: spacing,
                    crossAxisSpacing: spacing,
                    childAspectRatio: childAspectRatio,
                  ),
                  itemCount: filteredIcons.length,
                  itemBuilder: (context, index) {
                    final icon = filteredIcons[index];
                    final isSelected = widget.selectedIcon == icon.name;
                    return _IconGridItem(
                      icon: icon,
                      isSelected: isSelected,
                      size: widget.iconSize,
                      color: widget.iconColor,
                      animationType: isSelected
                          ? widget.animationType
                          : MconAnimationType.none,
                      animationDirection: widget.animationDirection,
                      duration: widget.duration,
                      curve: widget.curve,
                      onTap: () => widget.onIconSelected(icon.name),
                    );
                  },
                ),
        ),
      ],
    );
  }
}

/// Individual icon grid item with selection state
class _IconGridItem extends StatefulWidget {
  const _IconGridItem({
    required this.icon,
    required this.isSelected,
    required this.size,
    required this.color,
    required this.animationType,
    required this.animationDirection,
    required this.duration,
    required this.curve,
    required this.onTap,
  });

  final mcon.IconData icon;
  final bool isSelected;
  final double size;
  final Color color;
  final MconAnimationType animationType;
  final MconAnimationDirection animationDirection;
  final Duration duration;
  final Curve curve;
  final VoidCallback onTap;

  @override
  State<_IconGridItem> createState() => _IconGridItemState();
}

class _IconGridItemState extends State<_IconGridItem> {
  final GlobalKey<MconBaseState> _iconKey = GlobalKey<MconBaseState>();
  bool _isHovered = false;
  bool _isIconHovered = false;

  void _handleTap() {
    if (widget.isSelected) {
      // Already focused - trigger animation
      _iconKey.currentState?.forward();
    } else {
      // Not focused - just focus it
      widget.onTap();
    }
  }

  void _handleIconTap() {
    if (widget.isSelected) {
      // Trigger animation when clicking on icon in focused state
      _iconKey.currentState?.forward();
    }
  }

  @override
  Widget build(BuildContext context) {
    return MouseRegion(
      cursor: widget.isSelected && !_isIconHovered
          ? SystemMouseCursors.basic
          : SystemMouseCursors.click,
      onEnter: (_) => setState(() => _isHovered = true),
      onExit: (_) => setState(() => _isHovered = false),
      child: GestureDetector(
        onTap: _handleTap,
        child: AnimatedContainer(
          duration: const Duration(milliseconds: 200),
          padding: const EdgeInsets.all(16),
          decoration: BoxDecoration(
            color: widget.isSelected
                ? Theme.of(context).colorScheme.primaryContainer
                : _isHovered
                    ? Theme.of(context)
                        .colorScheme
                        .surfaceContainerHighest
                        .withValues(alpha: 0.5)
                    : Theme.of(context).colorScheme.surface,
            borderRadius: BorderRadius.circular(16),
            border: Border.all(
              color: widget.isSelected
                  ? Theme.of(context).colorScheme.primary
                  : Theme.of(context)
                      .colorScheme
                      .outline
                      .withValues(alpha: 0.2),
              width: widget.isSelected ? 2 : 1,
            ),
            boxShadow: widget.isSelected || _isHovered
                ? [
                    BoxShadow(
                      color: widget.isSelected
                          ? Theme.of(context)
                              .colorScheme
                              .primary
                              .withValues(alpha: 0.2)
                          : Colors.black.withValues(alpha: 0.05),
                      blurRadius: widget.isSelected ? 12 : 8,
                      offset: const Offset(0, 4),
                    ),
                  ]
                : null,
          ),
          child: Column(
            mainAxisAlignment: MainAxisAlignment.center,
            children: [
              // Icon container - takes available space
              Expanded(
                child: Center(
                  child: MouseRegion(
                    cursor: widget.isSelected
                        ? SystemMouseCursors.click
                        : SystemMouseCursors.basic,
                    onEnter: (_) => setState(() => _isIconHovered = true),
                    onExit: (_) => setState(() => _isIconHovered = false),
                    child: widget.isSelected
                        ? GestureDetector(
                            onTap: _handleIconTap,
                            child: SizedBox(
                              width: widget.size,
                              height: widget.size,
                              child: _buildIcon(),
                            ),
                          )
                        : IgnorePointer(
                            child: SizedBox(
                              width: widget.size,
                              height: widget.size,
                              child: _buildIcon(),
                            ),
                          ),
                  ),
                ),
              ),
              const SizedBox(height: 8),
              Text(
                widget.icon.displayName,
                style: Theme.of(context).textTheme.labelSmall?.copyWith(
                      fontWeight: widget.isSelected
                          ? FontWeight.w600
                          : FontWeight.normal,
                      color: widget.isSelected
                          ? Theme.of(context).colorScheme.primary
                          : Theme.of(context)
                              .colorScheme
                              .onSurface
                              .withValues(alpha: 0.7),
                    ),
                textAlign: TextAlign.center,
                maxLines: 1,
                overflow: TextOverflow.ellipsis,
              ),
            ],
          ),
        ),
      ),
    );
  }

