          curve: widget.curve,
        );
      case 'zone_person_urgent':
        return MconZonePersonUrgent(
          key: _iconKey,
          size: widget.size,
          color: widget.color,
          animationType: widget.animationType,
          animationDirection: widget.animationDirection,
          duration: widget.duration,
          curve: widget.curve,
        );
      case 'zoom_in':
        return MconZoomIn(
          key: _iconKey,
          size: widget.size,
          color: widget.color,
          animationType: widget.animationType,
          animationDirection: widget.animationDirection,
          duration: widget.duration,
          curve: widget.curve,
        );
      case 'zoom_in_map':
        return MconZoomInMap(
          key: _iconKey,
          size: widget.size,
          color: widget.color,
          animationType: widget.animationType,
          animationDirection: widget.animationDirection,
          duration: widget.duration,
          curve: widget.curve,
        );
      case 'zoom_out':
        return MconZoomOut(
          key: _iconKey,
          size: widget.size,
          color: widget.color,
          animationType: widget.animationType,
          animationDirection: widget.animationDirection,
          duration: widget.duration,
          curve: widget.curve,
        );
      case 'zoom_out_map':
        return MconZoomOutMap(
          key: _iconKey,
          size: widget.size,
          color: widget.color,
          animationType: widget.animationType,
          animationDirection: widget.animationDirection,
          duration: widget.duration,
          curve: widget.curve,
        );
      default:
        return Icon(Icons.widgets, size: widget.size, color: widget.color);
    }
  }
}

